32,-0.0065078735,0.016723633,0.033416748,0.037872314,0.010955811,-0.0045204163,0.0049972534,-0.040863037,-0.01625061,0.026641846,-0.021896362,-0.011245728,-0.027526855,-0.012763977,0.02709961,0.020996094,0.045043945,0.008110046,0.012573242,0.014755249,-0.025787354,-0.053497314,-0.02357483,-0.039733887,-0.023910522,0.07885742,0.026168823,-0.036987305,0.044525146,-0.058898926,-0.022003174,-0.021316528,0.009307861,0.02067566,0.013298035,0.0703125,0.031311035,-0.039093018,-0.0028533936,-0.013343811,0.03475952,-0.0128479,0.0053863525,-0.016983032,0.0038928986,-0.013931274,6.169081e-05,0.018615723,-0.060577393,-0.02029419,-0.026504517,-0.00983429,0.08276367,-0.016693115,-0.05618286,0.03540039,0.04864502,-0.03857422,0.008087158,0.020141602,0.016418457,0.0027618408,0.0072784424]', '나레이션: 그놈이 그처럼 여의해서 이삼 년 내에 오륙천 원이 되거들랑 그때는 미두장에서 손을 싹싹 씻고 서울로 올라간다. 올라가서 그놈을 밑천삼아 일이백 원, 이삼백 원, 기껏 커야 사오백 원짜리로, 이렇게 잔머리만 골라 ‘수형할인’을 떼어먹는다. 나레이션: 이것도 착실히만 하면, 한 십 년 후에 가서 몇만 원 잡을 수가 있다. 몇만 원 가졌으면 족히 평생이다. 나레이션: 그래야지, 만일 미두장에서만 어물어물하고 있다가는 피천 한푼 못 잡고, 근처의 수두룩한 하바꾼 신세가 되기 마침이다―---는 것이다. 나레이션: 이렇게 그는 투기사답지 않게 염량을 차리고, 그러한 두 가지 계획을 품고서 늘 기회를 엿보던 차에, 언덕이야시피 다들린 게 태수의 일이다. 나레이션: 그는 태수가 만일 말을 들어, 돈을 만 원이고 둘러 빼만 주면, 태수야 어떻게 되거나 말거나, 저 혼자서 그 돈을 쥐고 간다 보아라, 북경 상해 등지로 내뺄 뱃심이다.', 1, '{p_0230,p_0231,p_0232,p_0233,p_0234}', '2026-02-03 13:49:14.446013'),
