76,-0.017745972,-0.018585205,0.04360962,0.020980835,0.05215454,0.038513184,-0.029190063,-0.011375427,0.012924194,-0.0012340546,0.021270752,-0.020904541,-0.013130188,-0.055541992,-0.022445679,0.019470215,-0.007904053,-0.012382507,-0.013023376,-0.04574585,-0.051513672,-0.052490234,-0.037994385,-0.028701782,0.03277588,0.012039185,-0.06842041,0.008110046,-0.07165527,-0.025314331,-0.003540039,0.03765869,-0.011940002,0.025878906,0.021194458,0.04486084,-0.010925293,-0.013374329,0.005470276,0.009727478,-0.0046806335,-0.014526367,0.031173706,0.00018370152,-0.01071167,-0.013946533,0.012542725,-0.012161255,0.0024166107,-0.017318726,-0.002752304,0.055511475,-0.0057029724,0.025436401,0.046844482,0.041229248,0.005420685,0.00032019615,0.004131317,-0.09375,-0.0118255615,-0.03125]', '나레이션: 하고 말을 마치자, 좌우를 호령하여 빨리 토끼의 배를 가르고 간을 가져오라 하니... 토끼, 무단히 허욕을 내어 자라를 쫓아왔다가 수국 원혼이 되게 하니, 이는 모다 자취(自取)한 화라... 문득 한 꾀를 생각하여, 이에 얼굴빛을 조금도 변치 아니하고 머리를 들어 전상(殿上)을 우러러보며 가로되, 토끼: “소토(小兎), 비록 죽을지라도 한 말씀 아뢰리이다... 소토는 바로 짐승이오나 심상(尋常)한 짐승과는 다르와... 그 간이 진실로 영약이 되는지라... 꺼내어 청산녹수 맑은 물에 여러 번 씻사와 고봉준령 깊은 곳에 감추어 두옵고 다니옵다가, 우연히 자라를 만나 왔사오니, 만일 대왕의 환후 이러하온 줄 알았던들 어찌 가져오지 아니하였으리잇고?” 나레이션: 하며 또 자라를 꾸짖어 가로되, 토끼: “네 임금을 위하는 정성이 있을진대, 어이 이러한 사정을 일언반사(一言半辭)도 날 보고 말하지 아니하였느뇨?” 나레이션: 하거늘, 용왕이 이 말을 듣고 크게 노하여 꾸짖어 가로되,', 1, '{p_0005,p_0006,p_0007,p_0008,p_0009}', '2026-02-03 13:49:57.988060'),
