34497,-0.012161255,0.074523926,-0.05340576,0.013999939,-0.0039787292,-0.019821167,-0.008300781,0.0132369995,0.011734009,0.0045661926,-0.032165527,-0.003118515,-0.046783447,0.0014123917,0.022888184,0.015098572,0.0074272156,-0.020690918,-0.024017334,-0.042144775,-0.040130615,-0.037628174,-0.009239197,0.018112183,-0.03363037,-0.07006836,0.0073661804,-0.058563232,-0.019454956,-0.00041937828,0.054016113,0.009048462,-0.013710022,0.00944519,0.03604126,-0.033477783,-0.039764404,-0.016143799,0.01676941,0.017196655,-0.020843506,0.023544312,-0.022384644,-0.059295654,-0.00067186356,0.02935791,-0.010269165,0.030822754,-0.043518066,-0.0032863617,0.04107666,0.03616333,-0.006298065,0.04272461,-0.0067443848,0.030639648,-0.019546509,0.03439331,-0.064208984,0.021377563,-0.022857666]', '토끼: “소토의 간을 출입하는 곳의 내력을 말씀하오리니... 만물이 묘시(卯時)에 나와 짐승이 되었사오니, ''묘(卯)''라 하는 글자는 곧 소토의 별명이니... 일월성신 삼광(三光)을 받아 간을 출입하는 곳이 따로 있사오니... 소토의 몸에서 적간(摘奸)하옵소서.” 나레이션: 용왕이 이 말을 듣고 이상히 여겨 나졸을 명하여 자세히 보라 하니, 과연 간을 출입하는 곳이 따로 있는지라. 용왕이 아직 의혹하여 가로되, 용왕: “ 네 말이, 네 간을 능히 내는 곳이 있다 하니, 도로 넣을 제도 그리로 넣는가?” 나레이션: 토끼, 속으로 헤오대 ''이제는 내 계교가 거의 맞아 간다.''하고 여쭈오되, 토끼: “소토는 다른 짐승과 특별히 같지 아니하온 일이 많사오니... 간을 넣을 때에도 입으로 넣나이다.”', 1, '{p_0020,p_0021,p_0022,p_0023,p_0024}', '2026-02-03 13:49:58.006978'),
