.022140503,0.004501343,0.04272461,-0.024490356,0.025115967,0.01361084,-0.016906738,0.010391235,-0.012832642,-0.019805908,0.030166626,-0.038757324,-0.0154953,-0.046539307,-0.016799927,0.047607422,0.007572174,0.0067443848,-0.0070228577,-0.06878662,-0.052764893,-0.035583496,-0.03942871,-0.015007019,0.0067214966,0.0003376007,-0.047454834,0.031341553,-0.06976318,-0.028884888,-0.027038574,0.017745972,0.024978638,0.01499176,0.019851685,0.023269653,-0.006790161,-0.03173828,0.01612854,0.017150879,0.0013065338,-0.012184143,0.038269043,-0.004837036,-0.020263672,0.007896423,0.004989624,-0.021636963,0.012840271,-0.06262207,-0.013824463,0.06689453,0.012184143,0.012207031,0.026260376,0.011451721,0.015945435,0.018753052,0.0546875,-0.051116943,0.020629883,-0.04751587]', '토끼: “소토, 비록 간을 능히 출입하오나 또한 정한 때 있사오니... 달마다 초일일부터 십오일까지는 뱃속에 넣어... 십육일부터 삼십일까지는 줄기 아울러 꺼내어... 감추어 두는고로, 세상 사람이 영약이라 하는지라... 만일 자라, 대왕의 병세 이러하심을 말하였던들 수일 지체하여 가져왔을지니, 이는 다 자라의 무상함이로소이다.” 나레이션: 대저 용왕은 본성이 충후(忠厚)한지라, 토끼의 말을 듣고 묵묵히 말이 없으며... 차라리 저를 달래어 간을 가져오게 함이 옳도다.''하고, 이에 좌우를 명하여 토끼의 맨 것을 끄르고 맞으니 전상(殿上)에 올라 황공함을 이기지 못하거늘, 용왕이 가로되, 용왕: “토 처사는 나의 아까 실례함을 허물치 말라.” 나레이션: 하고, 이에 백옥배(白玉杯)에 천일주(千日酒)를 가득 부어 권하며 놀람을 진정하라 재삼 위로하니... 홀연, 한 신하 나아가 아뢰어 가로되, 자가사리: “신이 듣사오니 토끼는 본대 간사한 종류요... 바라옵건대 전하는 그 말을 곧이듣지 말으시고 바삐 그 간을 내어 옥체를 보중하옵소서. ”', 3, '{p_0028,p_0029,p_0030,p_0031,p_0032}', '2026-02-03 13:49:58.013854'),
