.0059928894,0.018722534,-0.0340271,0.03048706,0.0054740906,-0.020996094,0.012878418,-0.0051956177,-0.01676941,0.015434265,-0.037200928,-0.0031223297,-0.04324341,-0.022079468,0.04373169,0.013122559,-0.031311035,-0.019851685,-0.06439209,-0.049468994,-0.0287323,-0.04095459,-0.07336426,-0.009689331,0.015434265,-0.0925293,0.016708374,-0.05770874,-0.024108887,-0.007221222,0.06225586,0.0072364807,0.004337311,-0.014579773,0.0067710876,-0.01991272,-0.009300232,-0.0056610107,0.012672424,0.011520386,-0.005744934,0.046813965,-0.0017337799,-0.025894165,0.013694763,0.026565552,-0.030975342,0.02645874,-0.0625,-0.0065078735,0.059326172,0.0082092285,0.022781372,0.023468018,-6.80089e-05,0.009613037,0.005382538,0.0066375732,-0.062927246,-0.037719727,-0.02519226]', '나레이션: 하니, 자가사리, 분함을 못 이기나 하릴없이 물러나니, 용왕이 이에 크게 잔치를 베풀고 토끼를 대접할새... 나레이션: 이 때 토끼, 술에 반취하여 속으로 헤오대, ''내 간을 줄지라도 죽지 아니할 것 같으면 이 곳에서 늙으리라.''하더라. 용왕이 이에 토끼다려 가로되, 용왕: “과인이 수국에 처하고 그대는 산중에 있어 수륙이 격원하더니, 오늘 상봉함은 이 또한 천재(千載)에 기이한 인연이니... 그대는 과인을 위하여 간을 가져오면 과인이 어찌 그대의 두터운 은혜(恩惠)를 저바리리요?” 나레이션: 토끼, 웃음을 참지 못하나, 조금도 사색을 드러내지 아니코 흔연히 대답하여 가로되, 토끼: “대왕은 너무 염려치 마옵소서. 소토, 외람히 대왕의 너그러우신 덕을 입사와 잔명을 살았으니... 소토는 간이 없을지라도 사생(死生)에는 관계치 아니하오니 어찌 이것을 아끼리잇고?”', 1, '{p_0035,p_0036,p_0037,p_0038,p_0039}', '2026-02-03 13:49:58.026115'),
