6,-0.016860962,0.0209198,0.02067566,-0.029434204,0.01826477,0.0026226044,-0.0053482056,0.0018863678,-0.049804688,-0.0021133423,-0.016998291,-0.011787415,-0.018218994,-0.020996094,0.004840851,0.0069122314,-0.029586792,-0.05731201,-0.024154663,-0.021148682,-0.040496826,0.002401352,-0.011024475,-0.023971558,0.06323242,-0.06060791,-0.007663727,-0.015930176,0.060302734,-0.011444092,-0.017303467,0.024017334,0.025146484,-0.017227173,0.013442993,-0.024551392,0.008293152,0.008514404,-0.01776123,0.017669678,-0.025527954,-0.042816162,-0.025482178,0.036346436,-0.015167236,-0.036224365,0.03213501,-0.007911682,0.058624268,0.010787964,0.020050049,0.01889038,0.008026123,-0.013771057,-0.0027656555,-0.014335632,-0.07208252,0.01020813,-0.018463135]', '나레이션: 이 때, 토끼, 자라등에 다시 올라 만경창파를 건너 바닷가에 이르러 자라, 토끼를 내려놓으니, 토끼, 기꺼움을 못 이겨 스스로 생각하되, ''이는 진실로 그물을 벗어난 새요, 함정에서 뛰어나온 범이로다. 만일 나의 지혜 아니면 어찌 고향 산천을 다시 보리요?'' 하며 사면으로 뛰노는지라. 나레이션: 자라, 토끼의 모양을 보고 가로되, 자라: “우리의 길이 총망(悤忙)하니, 그대는 속히 돌아감을 생각하라.” 나레이션: 토끼, 크게 웃어 가로되, 토끼: “이 미련한 자라야, 대저 오장육부에 붙은 간을 어이 출납하리요? 이는 잠시 내 기특한 꾀로 너의 수국 군심(群心)을 속임이라... 너를 곧 없이하여 분을 풀 것이로되, 네, 나를 업고 만리창파에 왕래하던 수고를 생각지 아니치 못하여 잔명을 살려 이르되... 다시는 부질없이 망령된 생각을 내지 말라 하여라.”', 0, '{p_0001,p_0002,p_0003,p_0004,p_0005}', '2026-02-03 13:50:12.861547'),
