06,0.016326904,0.03274536,-0.008903503,-0.0034332275,-0.0007715225,-0.0036468506,-0.0357666,-0.016799927,0.03375244,-0.05126953,-0.009109497,-0.02835083,-0.018966675,0.015556335,0.009223938,0.028381348,-0.031707764,0.009544373,-0.0036373138,-0.04937744,-0.07116699,0.005092621,-0.0044937134,-0.021072388,0.029052734,-0.0289917,-0.043823242,0.06866455,-0.08392334,-0.029632568,0.013282776,0.0058174133,0.01689148,-0.016921997,0.008735657,-0.009986877,0.039398193,0.012794495,-0.0141067505,0.037506104,0.021743774,0.0103302,0.015823364,0.013885498,0.02128601,0.02116394,0.0014247894,-0.023773193,0.025817871,-0.05517578,-0.02999878,0.011077881,0.018173218,-0.06311035,0.047607422,0.019683838,-0.0034294128,-0.011077881,0.015914917,0.0035705566,-0.012886047,-0.013557434]', '나레이션: 허생은 만 냥을 입수하자, 다시 자기 집에 들르지도 않고 바로 안성(安城)으로 내려갔다. 안성은 경기도, 충청도 사람들이 마주치는 곳이요, 삼남(三南)의 길목이기 때문이다. 거기서 대추 밤 감 배며, 석류 귤 유자 등속의 과일을 모조리 두 배의 값으로 사들였다. 허생이 과일을 몽땅 쓸었기 때문에 온 나라가 잔치나 제사를 못 지낼 형편에 이르렀다. 얼마 안 가서, 허생에게 두 배의 값으로 과일을 팔았던 상인들이 도리어 열 배의 값을 주고 사 가게 되었다. 허생은 길게 한숨을 내쉬었다. 허생: “만 냥으로 온갖 과일의 값을 좌우했으니, 우리 나라의 형편을 알 만하구나.” 나레이션: 그는 다시 칼, 호미, 포목 따위를 가지고 제주도(濟州島)에 건너가서 말총을 죄다 사들이면서 말했다. 허생: “몇 해 지나면 나라 안의 사람들이 머리를 싸매지 못할 것이다.” 나레이션: 허생이 이렇게 말하고 얼마 안 가서 과연 망건 값이 열 배로 뛰어올랐다.', 0, '{p_0001,p_0002,p_0003,p_0004,p_0005}', '2026-02-03 13:50:41.457101'),
