21,0.00856781,0.029403687,0.033447266,0.009231567,-0.012176514,-0.012794495,0.037597656,-0.00699234,0.011383057,0.007762909,-0.007381439,0.013412476,-0.018859863,0.0074539185,0.04598999,0.014816284,0.0340271,-0.010009766,-0.015213013,0.010681152,-0.03564453,-0.10821533,-0.009239197,-0.012565613,-0.0022678375,0.025787354,0.055511475,0.014411926,0.008003235,-0.083496094,-0.029159546,0.023452759,0.018798828,-0.0010223389,-0.026031494,0.051574707,0.020339966,-0.015106201,0.027496338,-0.034118652,0.039215088,-0.016326904,-0.011131287,0.017456055,-0.0006580353,0.0012950897,-0.021575928,0.026428223,-0.022918701,-0.024459839,0.0017290115,0.025558472,0.05480957,-0.002374649,-0.043823242,0.005218506,0.02166748,-0.04147339,0.018234253,0.040802002,0.0051651,-0.005207062,-0.01272583]', '허생: “너희들, 힘껏 짊어지고 가거라.” 나레이션: 이에, 군도들이 다투어 돈을 짊어졌으나, 한 사람이 백 냥 이상을 지지 못했다. 허생: “너희들, 힘이 한껏 백냥도 못 지면서 무슨 도둑질을 하겠느냐? 인제 너희들이 양민(良民)이 되려고 해도, 이름이 도둑의 장부에 올랐으니, 갈 곳이 없다. 내가 여기서 너희들을 기다릴 것이니, 한사람이 백 냥씩 가지고 가서 여자 하나, 소 한 필을 거느리고 오너라.” 나레이션: 허생의 말에 군도들은 모두 좋다고 흩어져 갔다. 허생은 몸소 이천 명이 1년 먹을 양식을 준비라고 기다렸다. 군도들이 빠짐없이 모두 돌아왔다. 드디어 다들 배에 싣고 그 빈 섬으로 들어갔다. 허생이 도둑을 몽땅 쓸어 가서 나라 안에 시끄러운 일이 없었다.', 4, '{p_0032,p_0033,p_0034,p_0035}', '2026-02-03 13:50:41.490487'),
