62085,-0.006160736,0.034362793,0.015853882,-0.07940674,-0.005218506,0.01789856,-0.009864807,0.05142212,0.025604248,-0.008201599,0.02947998,-0.032073975,0.0077705383,-0.023727417,-0.018218994,0.009498596,-0.006427765,0.015167236,-0.016937256,-0.00077438354,-0.08703613,-0.01285553,0.005809784,-0.011878967,0.012542725,0.037322998,-0.05130005,0.055236816,-0.083740234,-0.018066406,-0.0129776,0.02444458,0.00082302094,-0.030731201,-0.032043457,0.03390503,0.004135132,0.012397766,-0.028274536,0.045898438,0.015548706,-0.020843506,0.020202637,0.030853271,0.002779007,-0.012214661,-0.019348145,-0.009536743,0.013717651,-0.05947876,0.022583008,0.06793213,0.024932861,-0.038909912,0.02758789,0.0066719055,-0.041259766,0.013954163,0.032073975,-0.010299683,0.019439697,-0.009674072]', '허생: “당신만이 내게 꼭 빌려 줄 수 있었던 것은 아니고, 능히 만 냥을 지닌 사람치고는 누구나 다 주었을 것이오. 내 스스로 나의 재주가 족히 백만 냥을 빌린 모을 수 있다고 생각했으나... 능히 나의 말을 들어 주는 사람은 복 있는 사람이라... 이미 만 냥을 빌린 다음에는 그의 복력에 의지해서 일을 한 까닭으로, 하는 일마다 곧 성공했던 것이고, 만약 내가 사사로이 했었다면 성패는 알 수 없었겠지요.” 나레이션: 변씨가 이번에는 딴 이야기를 꺼냈다. 변씨: “방금 사대부들이 남한산성에서 오랑캐에게 당했던 치욕을 씻어 보고자 하니, 지금이야말로 지혜로운 비가 팔뚝을 뽐내고 일어설 때가 아니겠소? 선생의 그 재주로 어찌 괴롭게 파묻혀 지내려 하십니까?” 나레이션: 허생이 대답했다. 허생: “어허, 자고로 묻혀 지낸 사람이 한둘이었겠소? 우선, 졸수재 조성기 같은 분은 적국에 사신으로 보낼 만한 인물이었건만 베잠방이로 늙어 죽었고, 반계 거사 유형원 같은 분은 군량을 조달할 만한 재능이 있었건만 저 바닷가에서 소요하고 있지 않습니까? 지금의 집정자들은 가히 알만한 것들이지요. 나는 장사를 잘 하는 사람이라, 내가 번 돈이 적히 구왕의 머리를 살 만하였으되 바닷속에 던져 버리고 돌아온 것은, 도대체 쓸 곳이 없기 때문이었지요.”', 2, '{p_0024,p_0025,p_0026,p_0027,p_0028}', '2026-02-03 13:50:57.449704'),
