6,0.01586914,-0.012741089,0.029327393,0.017486572,0.025741577,0.013710022,0.012588501,-0.01864624,-0.026794434,0.051513672,-0.0029506683,0.010292053,0.054870605,-0.044555664,0.03781128,0.0070381165,-0.010353088,0.07733154,-0.036102295,-0.0009007454,0.029800415,-0.031982422,-0.094055176,-0.028518677,0.0036125183,0.022583008,0.019165039,-0.010353088,-0.0018014908,0.016784668,-0.07110596,-0.025466919,-0.023086548,0.0440979,-0.009414673,-0.020339966,0.036224365,0.031036377,0.006008148,-0.008003235,0.0073776245,0.05822754,-0.023376465,-0.055664062,0.036315918,0.014602661,0.017196655,0.02229309,0.010368347,0.0023593903,0.043823242,-0.011962891,0.016571045,0.03729248,-0.018798828,-0.037902832,0.015731812,0.02947998,-0.042053223,9.191036e-05,0.06738281,0.0049057007,0.0051345825,0.03668213]', '허생: “무릇, 천하에 대의(大義)를 외치려면 먼저 천하의 호걸들과 접촉하여 결탁하지 않고는 안 되고, 남의 나라를 치려면 먼저 첩자를 보내지 않고는 성공할 수 없는 법이다... 국중의 자제들을 가려 뽑아 머리를 깎고 되놈의 옷을 입혀서... 저 땅의 호걸들과 결탁한다면 한번 천하를 뒤집고 국치(國恥)를 씻을 수 있을 것이다.” 나레이션: 이 대장은 힘없이 말했다. 이 대장(이완): “사대부들이 모두 조심스럽게 예법(禮法)을 지키는데, 누가 변발(髮)을 하고 호복(胡服)을 입으려 하겠습니까?” 나레이션: 허생은 크게 꾸짖어 말했다. 허생: “소위 사대부란 것들이 무엇이란 말이냐? 오랑캐 땅에서 태어나 자칭 사대부라 뽐내다니, 이런 어리석을 데가 있느냐?... 내가 세 가지를 들어 말하였는데, 너는 한 가지도 행하지 못한다면서 그래도 신임받는 신하라 하겠는가? 신임받는 신하라는 게 참으로 이렇단 말이냐? 너 같은 자는 칼로 목을 잘라야 할 것이다.”', 1, '{p_0020,p_0021,p_0022,p_0023,p_0024}', '2026-02-03 13:51:07.744477'),
